    async function getNewRecipes (call){

        let response = await fetch (call);
        let data = await response.json();

        console.log(data);

    }

    //capture Recipe API data


    return (
        <section onClick = {() => getNewRecipes(call)}>
            <a href="#clickme">Click Me</a>
